import { defineMessages } from 'react-intl';

export const scope = 'app.containers.accounts';

export default defineMessages({
  selectWorkshops: {
    id: `${scope}.selectWorkshops`,
    defaultMessage: 'Select Workshops',
  },
  workshopName: {
    id: `${scope}.workshopName`,
    defaultMessage: 'Workshop Name',
  },
  cash: {
    id: `${scope}.cash`,
    defaultMessage: 'Cash',
  },
  onlinePayment: {
    id: `${scope}.onlinePayment`,
    defaultMessage: 'Online Payment',
  },
  collectLater: {
    id: `${scope}.collectLater`,
    defaultMessage: 'Collect Later',
  },
  deliveryOptions: {
    id: `${scope}.deliveryOptions`,
    defaultMessage: 'Delivery Options',
  },
  selfPickup: {
    id: `${scope}.selfPickup`,
    defaultMessage: 'Self Pickup',
  },
  arrangeDelivery: {
    id: `${scope}.arrangeDelivery`,
    defaultMessage: 'Arrange Delivery',
  },
  paymentOptions: {
    id: `${scope}.paymentOptions`,
    defaultMessage: 'Payment Options',
  },
});
